const FlightsTabsCon = [
  {
    id : 'roundTrip',
    className : 'tab-pane active',
    content : "<RoundTrip />"
  },
  {
    id : 'oneway',
    className : 'tab-pane fade',
    content : "<Oneway />"
  },
  {
    id : 'multiCity',
    className : 'tab-pane fade',
    content : "<MultiCity />"
  }
]

export default FlightsTabsCon;
